import copy
# from my_tools.time_prof import g_time_prof


class Heap(object):
    def __init__(self, values, cmp_left_to_head, index_of_pos):
        self._cmp_left_to_head = cmp_left_to_head
        self._values = copy.copy(values)
        self._index_of_pos = index_of_pos

        for index in range(0, len(self._values)):
            self._values[index][self._index_of_pos] = index

        for index in range(1, len(self._values)):
            self._to_head(index)

    def head(self):
        return self._values[0]

    def re_index(self, index):
        self._to_head(index)
        self._to_tail(index)

    def _to_head(self, index):
        cur = index
        while cur > 0:
            p = self._parent(cur)
            if self._cmp_left_to_head(self._values[p], self._values[cur]):
                break
            self._values[p], self._values[cur] = self._values[cur], self._values[p]
            self._values[p][self._index_of_pos] = p
            self._values[cur][self._index_of_pos] = cur
            cur = p

    def _to_tail(self, index):
        p = index
        while True:
            l = self._left(p)
            r = self._right(p)
            n = p
            if l < len(self._values) and self._cmp_left_to_head(self._values[l], self._values[n]):
                n = l
            if r < len(self._values) and self._cmp_left_to_head(self._values[r], self._values[n]):
                n = r
            if n == p:
                break
            self._values[p], self._values[n] = self._values[n], self._values[p]
            self._values[p][self._index_of_pos] = p
            self._values[n][self._index_of_pos] = n
            p = n

    def _parent(self, index):
        assert index > 0
        return (index - 1) / 2

    def _left(self, index):
        return index * 2 + 1

    def _right(self, index):
        return index * 2 + 2


class Solution(object):
    def minWindow(self, s, t):
        """
        :type s: str
        :type t: str
        :rtype: str
        """

        # g_time_prof.prof()
        # key: char in s
        # value: index_list
        # e.g.  {'A': [0, 10], 'C': [5, 12], 'B': [3, 9], 'E': [4, 8], 'D': [1, 7], 'O': [2, 6], 'N': [11]}
        char_index_list_map = {}
        for i, c in enumerate(s):
            l = char_index_list_map.setdefault(c, [])
            l.append(i)

        # g_time_prof.prof()
        # key: char in t
        # value: [index_list, repeat_count]
        # e.g. {'A': [[0, 10], 1], 'C': [[5, 12], 1], 'B': [[3, 9], 1]}
        index_map = {}
        for c in t:
            if c not in char_index_list_map:
                return ''
            tmp = index_map.setdefault(c, [char_index_list_map[c], 0])
            tmp[1] += 1

        # g_time_prof.prof()
        # [[index_list, repeat_count, start_pos_in_index_list, end_pos_in_index_list], ... ]
        # e.g. [[[0, 10], 1, 0, 0], [[5, 12], 1, 0, 0], [[3, 9], 1, 0, 0]]
        index_list = []
        for l, cnt in index_map.values():
            if len(l) < cnt:
                return ''
            index_list.append([l, cnt, 0, cnt - 1, 0, 0])

        def _get_pos(indexes, index):
            return indexes[0][indexes[index]]

        # g_time_prof.prof()
        left_heap =  Heap(index_list, lambda a, b: _get_pos(a, 2) < _get_pos(b, 2), 4)
        right_heap = Heap(index_list, lambda a, b: _get_pos(a, 3) > _get_pos(b, 3), 5)
        result = s

        # g_time_prof.prof()

        while True:
            indexes = left_heap.head()
            left_index = _get_pos(indexes, 2)
            right_index = _get_pos(right_heap.head(), 3)
            tmp_result = s[left_index:right_index + 1]
            if len(result) > len(tmp_result):
                result = tmp_result

            # print index_list, result, tmp_result
            indexes[2] += 1
            indexes[3] += 1
            if indexes[3] >= len(indexes[0]):
                break
            left_heap._to_tail(indexes[4])
            right_heap._to_head(indexes[5])

        # g_time_prof.prof()
        return result


